import React from 'react'

class Props extends React.Component {
    render() {
        return (
            <div className="box">
                <h3>Props part</h3>
                <Datas />
            </div>
        )
    }
}

class Datas extends React.Component {
    render() {
        return (
            <div className="box-white">
                <h3>Welcome, </h3>
                <h1>{this.props.username}!</h1>
            </div>
        )
    }
}
export default Props
